import React, { useContext, Suspense, lazy } from "react";
import "./Project.scss";
import Button from "../../components/button/Button";
import StyleContext from "../../contexts/StyleContext";
import Loading from "../../containers/loading/Loading";

export default function Projects() {
  const GithubRepoCard = lazy(() =>
    import("../../components/GithubRepoCard/GithubRepoCard")
  );

  const { isDark } = useContext(StyleContext);

  const projectList = [
    {
      id: 1,
      name: "My Awesome Project",
      description: "This is a cool project I built using React and Node.js.",
      githubUrl: "https://github.com/username/project1",
      websiteUrl: "https://project1.example.com",
    },
    {
      id: 2,
      name: "Another Cool App",
      description: "This is another awesome app built using Next.js.",
      githubUrl: "https://github.com/username/project2",
      websiteUrl: "https://project2.example.com",
    },
    {
      id: 3,
      name: "Portfolio Website",
      description: "My personal portfolio made with HTML, CSS, and JS.",
      githubUrl: "https://github.com/username/portfolio",
      websiteUrl: "https://portfolio.example.com",
    },
    // Add more projects if you want
  ];

  return (
    <Suspense fallback={<Loading />}>
      <div className="main" id="opensource">
        <h1 className="project-title">Projects</h1>
        <div className="repo-cards-div-main">
          {projectList.map((project) => (
            <GithubRepoCard
              key={project.id}
              project={project}
              isDark={isDark}
            />
          ))}
        </div>
        <Button
          text={"View More Projects"}
          className="project-button"
          href={socialMediaLinks.github}
          newTab={true}
        />
      </div>
    </Suspense>
  );
}
